import React from "react";
import PromotionCard from "./components/Promotion/Card";

const App = () => {
  const promotion = {
    title: "foda",
    price: "123",
  };
  return (
    <div>
      <PromotionCard test='Vinicios' />
    </div>
  );
};
export default App;
